function HeaderName () {
    return (
        <p>Job Search</p>
    )
}

function HeaderChapters() {
    return(
        <>
        <a>Исполнителю</a>
        <a>Заказчику</a>
        </>
    )
}

function HeaderLogin () {
    return (
        <button className="login">Войти</button>
    )
}

export default function HeaderContent() {
    return (
        <>
        <HeaderName />
        <HeaderChapters />
        <HeaderLogin />
        </>   
    )
    
};
